import React from 'react'
import iAMi from '../assets/images/iAMi.jpg';

function ProfileImage() {
    return (
        <div className="nav-profile">
        <img
          src={iAMi}
          alt="Profile"
          className="w-42 h-42 rounded-full object-cover shadow-lg"
        />
      </div>
    );
  }

  export default ProfileImage;
